@Component({
  selector: 'app-not-found',
  templateUrl: './not-found.component.html',
  styleUrls: ['./not-found.component.scss']
})
export class NotFoundComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<div class="center">
  <h2>No corresponding page found</h2>
  <a routerLink="">Go back</a>
</div>
